import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import Home from "./Home";
import Cart from "./Cart";
import Footer from "./Footer";

import { CartProvider } from "react-use-cart";

function App() {
  return (
   <>
   <CartProvider>
<Home/>
<Cart/>
<Footer/>
</CartProvider>
   </>
  );
}

export default App;
